import React from "react";
import { Table } from "react-bootstrap";

import "./css/Total.css";

export default class Total extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Total">
        <Table>
          <tr>
            <th>Total:</th>
            <th>{"£ " + "0.00"}</th>
          </tr>
        </Table>
      </div>
    );
  }
}
